const FC = () =>{
    
    const data = [
        {id:1, lang:'TEL'},
        {id:2, lang:'ENG'},
        {id:3, lang:'HIN'}
    ]
    return(
        <>
        <h3>These is the list and keys in the react js</h3>
        {data.map((ele) =>{
            return <h1>{ele.lang}</h1>
        })}
        </>
    )
}
export default FC;
